fetch("/api/").catch(t=>M.toast({html:t})).then(t=>t.json()).then(t=>{const e=document.querySelector(".collection");t.forEach(t=>{e.innerHTML+="<a class='collection-item indigo-text' href='/c/"+t+"'>"+t+"</a>"}),e.onchange=(()=>{window.location="/c/"+e.selectedOptions[0].text}),M.AutoInit(document.body)});